import React from 'react';
import Calculator from './Calculator'; // Import the Calculator component
import PeterNumberCalculator from './PeterNumberCalculator'; // Import the PeterNumberCalculator component

const App = () => {
  return (
    <div style={styles.appContainer}>
      <Calculator />
      <PeterNumberCalculator />
    </div>
  );
};

const styles = {
  appContainer: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    height: '100vh',
    flexDirection: 'column',
  },
};

export default App;
